This is a collection of Dorcel's Pornochic movies. The series consists of 25 movies, all directed by Herve Bodilis for Marc Dorcel. All of the movies are webrips, not re-encoded.
Quality depends mostly on the age of the movies. The older ones are at 576p, the more recent ones at 1080p. Overall there are 16 movies @576p, 1 movie @720p and 8 movies @1080p.
The content is everything you could expect from a Bodilis/Dorcel movie. Mainly european girls, usually in lingerie, do almost everything: lesbian, straight, anal, DPs in 1on1, 3some or even some orgy scenes
